import React from 'react';

function SearchBar() {
  return (
    <div>
      <input type="text" data-testid="search-input" placeholder="search itens" />
      <p>Select a type of search</p>
      <div className="radios">
        <label htmlFor="ing">
          Ingredient
          <input
            type="radio"
            data-testid="ingredient-search-radio"
            id="ing"
            value="ingredient"
          />
        </label>
      </div>

    </div>
  );
}

export default SearchBar;
